    false,nt"url": null,nt"notes": "This dataset contains well log observations
    compiled by the Ohio Department of Natural Resources, and published as a Web feature
    service for the National Geothermal Data System. Fields in the Well Log Observation
    Content Model will become XML elements in interchange documents for WMS simple features
    provided by a node in the USGIN network.  Each feature includes an Display name,
    Log type as well as Latitude and Longitude spatially referenced to EPSG: 4326 (for
    interoperability).  The data contained in the submitted dataset is available as
    an Excel Spreadsheet, ESRI service, WMS and WFS service. For information see links
